text382755.addInnerText('<div id=\"text382755\" aria-live=\"polite\" ><a id=\"text382755anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<p lang=\"en\"  legLH=\"1.107\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382755Font5\"  >​​</span ><span class=\"text382755Font6\"  >What do I register in the CDR?\n</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text382755Font5\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382755CircleBulletFont10.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382755Font5\"  >All printed </span ><span class=\"text382755Font6\"  >TOP SECRET</span ><span class=\"text382755Font5\"  > and accountable material</span ><span class=\"text382755Font6\"  > must </span ><span class=\"text382755Font5\"  >be registered in a CDR (separate from all other classified material).\n</span ></li >\n<li  class=\"text382755Font5\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382755CircleBulletFont10.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382755Font5\"  >It is strongly recommended </span ><span class=\"text382755Font6\"  >SECRET </span ><span class=\"text382755Font5\"  >material is registered in a CDR. DISP members </span ><span class=\"text382755Font6\"  >must</span ><span class=\"text382755Font5\"  > register </span ><span class=\"text382755Font6\"  >SECRET</span ><span class=\"text382755Font5\"  > material.\n</span ></li >\n<li  class=\"text382755Font5\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382755CircleBulletFont10.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382755Font5\"  >Individual areas </span ><span class=\"text382755Font8\"  >may </span ><span class=\"text382755Font5\"  >choose to register other classified material in their CDR, if their local risk environment requires it.\n</span ></li >\n</ul >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382755Font6\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382755Font6\" style=\"position:relative;top:-1px;\" >When do I register in a CDR?\n</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text382755Font5\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382755CircleBulletFont10.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382755Font5\"  >Draft documents </span ><span class=\"text382755Font6\"  >must</span ><span class=\"text382755Font5\"  > be registered in your CDR within seven days of creation - no matter what stage of development.\n</span ></li >\n<li  class=\"text382755Font5\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382755CircleBulletFont10.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382755Font8\"  >Completed</span ><span class=\"text382755Font5\"  > documents </span ><span class=\"text382755Font6\"  >must</span ><span class=\"text382755Font5\"  > be registered in your CDR as soon as they are finalised.\n</span ></li >\n</ul >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382755Font5\" style=\"position:relative;top:-1px;\" >​\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382755Font6\" style=\"position:relative;top:-1px;\" >What type of CDR do I use?\n</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text382755Font5\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382755CircleBulletFont10.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382755Font5\"  >Defence commonly uses the XC40 form and defence industry use the AC458 form.​\n</span ></li >\n</ul >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
text382755.build()

text375987Font1\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n</span ></p >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
